package jparsec.ephem.planets.imcce;

// One ELP2000 term

class Elp2000Set1 {
	Elp2000Set1( int ilu[], double[] coef) { ILU=ilu; COEF=coef;}
  int[] ILU = new int[4];
  double[] COEF = new double[7];
};
class Elp2000Set2 {
	Elp2000Set2( int ilu[], double[] coef) { ILU=ilu; COEF=coef;}
  int[] ILU = new int[5];
  double[] COEF = new double[3];
};
class Elp2000Set3 {
	Elp2000Set3( int ilu[], double[] coef) { ILU=ilu; COEF=coef;}
  int[] ILU = new int[11];
  double[] COEF = new double[3];
};

/**
 * All the static data of the ELP2000 theory (part 1), in a
 * separate file for managability. The whole theory is applied. This is part 1
 * (from 2) of the data.
 * <P>
 * Library users can ignore this class.
 * <P>
 * <I><B>Reference</B></I>
 * <P>
 * ELP 2000-85: a semi-analytical lunar ephemeris adequate for historical times.
 * Chapront-Touze M., Chapront J. Astron. and Astrophys. 190, 342 (1988).
 *
 * @author T. Alonso Albi - OAN (Spain)
 * @since version 1.0
 */
public final class Elp2000_data1 {
	// private constructor so that this class cannot be instantiated.
	private Elp2000_data1() {}
}

